(1, '8706', 'Que el (la) señor(a) _, identificado (a) con _ No. _ de Bogotá DC, celebró con EL SERVICIO NACIONAL DE APRENDIZAJE SENA, el (los) siguiente(s) contrato(s) de prestación de servicios personales regulados por la Ley 80 de 1993 (Estatuto General de Contratación de la Administración Pública), modificada por la Ley 1150 de 2007, Decreto 1082 de 2015 y sus demás decretos o normas reglamentarias, como se describe a continuación:', '1. Participar en aspectos técnicos para el área de electricidad. 2. Apoyar en el montaje, implementación, mantenimiento, de material didáctico. 3. Apoyar el acompañamiento y brindar soporte al centro de formación en la ejecución de procesos del área eléctrica, 4. Apoyar en el suministro de la información a los instrumentos, insumos y documentos requeridos para la transferencia de Conocimiento. 5. Presentar informes periódicos sobre las actividades realizadas ante las dependencias y entidades que lo requieran. 6. Participar de las reuniones y actividades que sean requeridas para la adecuada ejecución del contrato. 7. Las demás que se requieran para desarrollar el objeto del contrato', 'La prestación de servicios personales para apoyar a las regionales y al centro de electricidad electrónica ytelecomunicaciones en aspectos tecnológicos para la participación del Sena en competencias de alto rendimiento en habilidades worldskills. ', 'tmp/seals/$2y$10$JntTsmUOlE1o2q/lisqdseSLlLV89GIYqoEzB3k9bonBABxQXTChq.jpg', '2019-12-14 17:52:20', '2019-12-14 17:52:20'),
